import React from "react";

function Jumbotron({ children }) {
  return (
    <div
      style={{ height: 200, clear: "both", paddingTop: 75, textAlign: "center", backgroundColor: "none"}}
      className="jumbotron"
    >
      {children}
    </div>
  );
}

export default Jumbotron;
